import React, { Component } from 'react';

export default class Reviews extends Component {
  constructor (props) {
    super(props);

    this.state = {
      activeSlideId: 0
    };
  }

  changeSlide = slideId => {
    this.setState({
      activeSlideId: slideId
    });
  }

  render () {
    var activeSlideId = this.state.activeSlideId;

    return <div>
        <div className="page__container-bg">
        <div className="page__body page__body-rows">
          <h2 className="page__title content-center layout__space"></h2>
        </div>
      </div>
      <div className="review_group">
        <div className="page__body page__body-rows">
          <div className="review_group__reviews">
            {activeSlideId == 0 && <blockquote className="review">
              <p className="review__body content">
                Someday, I hope that we will all be patriots of our planet and not just of our respective nations.
              </p>
              <footer className="review__author">
                <section className="user_box">
                  <div className="user_box__body">
                    <p className="user_box__name"><b>Zoe Weil</b></p>
                    <p className="user_box__text"><a href="http://humaneeducation.org/blog/resource/most-good-least-harm-a-simple-principle-for-a-better-world-and-meaningful-life/">Most Good, Least Harm: A Simple Principle for a Better World and Meaningful Life</a></p>
                  </div>
                </section>
              </footer>
            </blockquote>}
            {activeSlideId == 1 && <blockquote className="review">
              <p className="review__body content">
                A few generations ago youth accepted its lower status, accepted the directions of the fathers and their symbols. Today youth rebels but in a futile way. Its weird haircuts, its leather jackets, its blue jeans, its motor bikes are all symbols of rebellion but symbols that remain symbols. In essentials youth is still docile, obedient, inferior: it challenges the things that do not matter - clothes, manners, hairstyles.
              </p>
              <footer className="review__author">
                <section className="user_box">
                  <div className="user_box__body">
                    <p className="user_box__name"><b>A.S. Neill</b></p>
                    <p className="user_box__text"><a href="https://en.wikipedia.org/wiki/A._S._Neill Math teacher">Scottish educator and author, founder of Summerhill School</a></p>
                  </div>
                </section>
              </footer>
            </blockquote>}
            {activeSlideId == 2 && <blockquote className="review">
              <p className="review__body content">
                We have sold ourselves into a fast food model of education, and it's impoverishing our spirit and our energies as much as fast food is depleting our physical bodies.
              </p>
              <footer className="review__author">
                <section className="user_box">
                  <div className="user_box__body">
                    <p className="user_box__name"><b>Ken Robinson</b></p>
                    <p className="user_box__text"><a href="http://sirkenrobinson.com/finding-your-element/">The Element: How Finding Your Passion Changes Everything</a></p>
                  </div>
                </section>
              </footer>
            </blockquote>}
          </div>
        </div>
      </div>
      <div className="page__container-bg">
        <div className="review_group__navigation page__body">
          <ReviewUser onClick={this.changeSlide} index="0" activeIndex={activeSlideId} avatarUrl="data:image/png;base64," />
          <ReviewUser onClick={this.changeSlide} index="1" activeIndex={activeSlideId} avatarUrl="data:image/jpeg;base64," />
          <ReviewUser onClick={this.changeSlide} index="2" activeIndex={activeSlideId} avatarUrl="data:image/jpeg;base64," />
        </div>
      </div>
    </div> ;
  };
}

class ReviewUser extends Component {
  clickHandler = () => {
    var { onClick, index } = this.props;

    onClick(index);
  }

  render () {
    var { index, activeIndex, avatarUrl } = this.props;
    var cn = 'review_group__navigation_item ';

    if (index == activeIndex) {
      cn += 'review_group__navigation_item-active';
    }

    return <div onClick={this.clickHandler} className={cn}>
      <div className="user_box">
        <img className="user_box__avatar" src={avatarUrl} width="64px" height="64px" alt=""/>
      </div>
    </div>;
  }
}
